description:
Wendy travels back in time to 1995 to avert a horrific dystopian present by preventing her younger self from a future-threatening masturbation.  Wendy uses her superpower of seduction to bed her past self, saving the universe with wibby wobbly timey wimey stuff.  Paradoxes be damned, this ex-man knows no bounds in her quest to save the present.  Featuring the return of Amy Gray as young Wendy Summers.

